import React from 'react';

import './style.css';

const SocialLinkIcon = ({ href, iconClass }) => {
  return (
    <a className="header-icon" href={href}>
      <i className={`fab ${iconClass}`}></i>
    </a>
  )
};

export default SocialLinkIcon;
